# from pudb import set_trace; set_trace()
from typing import List
import math
from collections import defaultdict


class Solution:
    def minJumps(self, arr: List[int]) -> int:
        """LeetCode 1345

        Old problem, but tool three tries. The main idea is to turn the problem
        into a graph. Then we can use BFS to solve it. However, there is one
        big issue of repeatedly checking nodes of the same value. To avoid
        doing so, once a node has been checked, its value shall be removed from
        the value-to-index mapping. This way, all the other nodes of the same
        value will not repeat the checking again during BFS.

        O(N), 732 ms, faster than 91.38%

        UPDATE: reduce the number of lines
        """
        m = defaultdict(list)
        for i, a in enumerate(arr):
            m[a].append(i)
        N = len(arr)

        queue = [0]
        seen = set([0])
        res = 0
        while queue:
            tmp = []
            for idx in queue:
                if idx == N - 1:
                    return res
                for nei in m[arr[idx]] + [idx + 1, idx - 1]:
                    if nei not in seen and 0 <= nei < N:
                        seen.add(nei)
                        tmp.append(nei)
                del m[arr[idx]]
            res += 1
            queue = tmp
        return res
        

sol = Solution()
